import Vue from 'vue';
import App from './App.vue';
Vue.config.productionTip = false;
//引入路由
import router from '@/router';
new Vue({
  render: h => h(App),
  //注册路由:键值对写法 ES6新语法省略值
  //注册路由 当这里书写router的时候，组件身上都有$route,
  router
}).$mount('#app')
